import React from "react";

const Trails = () => {
  const backgroundStyle = {
    backgroundImage: `url('images/Rectangle3.png')`,
    backgroundSize: "cover",
    backgroundRepeat: "no-repeat",
  };
  return (
    <div className="flex justify-center">
      <div
        className="mt-28 h-[364px] w-[1264px] flex justify-center items-center flex-col text-center"
        style={backgroundStyle}
      >
        <h1 className="text-white">JOIN OUR COMMUNITY</h1>

        <h1 className="text-4xl text-white">
          We are trusted by over 5000+ clients. <br />
          Join them now and grow your reach with us.
        </h1>
      </div>
    </div>
  );
};

export default Trails;
